import React, { Component } from 'react';
import MainTutorial from '../../tutorial/maintutorial'
import '../_form.scss'

class Tutorial extends Component{

    skipBtn ={
        position: "absolute",
        bottom: "5%",
        right: "2%",
        border: "0",
        fontSize: "20px"

    }
    skip = (e) =>{
        e.preventDefault();
        this.props.nextStep();
    }

    render(){
        return(
            <div>
                <MainTutorial/>
                <button style = {this.skipBtn} onClick={this.skip}>
                    Skip >
                </button>
            </div> 
        )
    }
}

export default Tutorial;
